import React, {Component} from 'react';
import {Router, Link} from '@reach/router';

import {fetchIndividualArticle} from '../utils/api';

class IndividualArticle extends Component {
	state = {
		article: {},
	};
	componentDidMount() {
    return fetchIndividualArticle(this.props.id)
	}
	render() {
		return (
			<div>
				<h1>Article</h1>
			</div>
		);
	}
}

export default IndividualArticle;
